void demoPolygon(void)
{
    glColor3f(0.0, 0.54,0.54);
    glPolygonMode(GL_FRONT_AND_BACK,GL_FILL);
    glBegin(GL_POLYGON);
    glVertex3f(2.25,0.25,0.4);
    glVertex3f(2.75,2.25,0.4);
    glVertex3f(2.75,0.75,-0.9);
    glVertex3f(5.0,0.75,0.4);
    glEnd();
    glPolygonMode(GL_FRONT_AND_BACK,GL_FILL);
}

void drawOctahedronFrame(double size, double line_width, Eigen::Isometry3d& Twc)
{
    // 先绘制图像,再转移变换到任意位置的示例
    std::vector<GLfloat> glTwc=eigen2glfloat(Twc);


    // 绘制参数, 正方形边长 2a, 高度b
    const double a=size;
    const double b=a*sqrt(2);

    // 要和后面的 popMatrix 成对出现
    glPushMatrix();
    glMultMatrixf((GLfloat*)glTwc.data());

    glLineWidth(line_width);
    // 颜色
    glColor3f(0.8f,0.54f,0.78f);
    // 绘制直线,每两个点组成一个线段
    glBegin(GL_LINES);

    // 绘制正方形
    glVertex3f(a,a,0);
    glVertex3f(a,-a,0);
    glVertex3f(a,-a,0);
    glVertex3f(-a,-a,0);
    glVertex3f(-a,-a,0);
    glVertex3f(-a,a,0);
    glVertex3f(-a,a,0);
    glVertex3f(a,a,0);


    // 连接上部顶点
    glVertex3f(a,a,0);
    glVertex3f(0,0,b);
    glVertex3f(a,-a,0);
    glVertex3f(0,0,b);
    glVertex3f(-a,-a,0);
    glVertex3f(0,0,b);
    glVertex3f(-a,a,0);
    glVertex3f(0,0,b);

    // 连接下部顶点
    glVertex3f(a,a,0);
    glVertex3f(0,0,-b);
    glVertex3f(a,-a,0);
    glVertex3f(0,0,-b);
    glVertex3f(-a,-a,0);
    glVertex3f(0,0,-b);
    glVertex3f(-a,a,0);
    glVertex3f(0,0,-b);

    glEnd();
    glPopMatrix();
}

