void drawOctahedronTriangles(double size, double line_width, Eigen::Isometry3d& Twc)
{
    std::vector<GLfloat> glTwc=eigen2glfloat(Twc);

    const double a=size;
    const double b=a*sqrt(2);

    glPushMatrix();
    glMultMatrixf((GLfloat*)glTwc.data());

    glLineWidth(line_width);
    // 颜色
    glColor3f(0.1f,1.0f,0.32f);
    // 绘制三角面片
    glBegin(GL_TRIANGLES);
    // 先绘制正方形上方的四个三角片
    glVertex3f(a,a,0);
    glVertex3f(a,-a,0);
    glVertex3f(0,0,b);

    glVertex3f(a,a,0);
    glVertex3f(-a,a,0);
    glVertex3f(0,0,b);

    glVertex3f(-a,-a,0);
    glVertex3f(a,-a,0);
    glVertex3f(0,0,b);

    glVertex3f(-a,-a,0);
    glVertex3f(-a,a,0);
    glVertex3f(0,0,b);

    // 然后是正方形下方的四个三角片
    glVertex3f(a,a,0);
    glVertex3f(a,-a,0);
    glVertex3f(0,0,-b);

    glVertex3f(a,a,0);
    glVertex3f(-a,a,0);
    glVertex3f(0,0,-b);

    glVertex3f(-a,-a,0);
    glVertex3f(a,-a,0);
    glVertex3f(0,0,-b);

    glVertex3f(-a,-a,0);
    glVertex3f(-a,a,0);
    glVertex3f(0,0,-b);

    glEnd();

    // 为了可视化效果,再绘制线框(和drawOctahedronFrame2中操作相同)
    glColor3f(0.0f,0.0f,0.0f);
    glLineWidth(10*line_width);

    glBegin(GL_LINE_LOOP);
    // 先绘制正方形
    glVertex3f(a,a,0);
    glVertex3f(a,-a,0);
    glVertex3f(-a,-a,0);
    glVertex3f(-a,a,0);
    glEnd();

    glBegin(GL_LINE_LOOP);
    // 继续绘制
    glVertex3f(0,0,b);
    glVertex3f(a,a,0);
    glVertex3f(0,0,-b);
    glVertex3f(-a,-a,0);
    glEnd();

    glBegin(GL_LINE_LOOP);
    // 继续绘制
    glVertex3f(0,0,b);
    glVertex3f(a,-a,0);
    glVertex3f(0,0,-b);
    glVertex3f(-a,a,0);
    glEnd();

    glPopMatrix();

}



